DROP TABLE IF EXISTS chronicle;

CREATE TABLE `chronicle` (
  `log_id` int(11) NOT NULL AUTO_INCREMENT,
  `table_id` int(11) NOT NULL,
  `tablename` varchar(50) NOT NULL,
  `action` varchar(20) NOT NULL,
  `whoid` int(11) NOT NULL,
  `whoname` varchar(50) NOT NULL,
  `ddate` varchar(30) NOT NULL,
  `dtime` varchar(30) NOT NULL,
  PRIMARY KEY (`log_id`)
) ENGINE=MyISAM AUTO_INCREMENT=270 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS colleges;

CREATE TABLE `colleges` (
  `college_id` int(11) NOT NULL AUTO_INCREMENT,
  `college` text NOT NULL,
  `collegecode` varchar(10) NOT NULL,
  PRIMARY KEY (`college_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS coresult;

CREATE TABLE `coresult` (
  `sn` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(60) NOT NULL,
  `matric_no` char(255) NOT NULL,
  `code` varchar(10) NOT NULL,
  `unit` int(11) NOT NULL,
  `score` varchar(5) NOT NULL,
  `grade` varchar(5) NOT NULL,
  `points` varchar(10) NOT NULL,
  `programme` varchar(255) NOT NULL,
  `semester` varchar(255) NOT NULL,
  `session` varchar(255) NOT NULL,
  `stat` int(1) NOT NULL,
  `year` int(11) NOT NULL,
  PRIMARY KEY (`sn`),
  UNIQUE KEY `matric_no` (`matric_no`,`code`,`semester`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS course;

CREATE TABLE `course` (
  `sn` int(11) NOT NULL AUTO_INCREMENT,
  `prog_id` varchar(255) NOT NULL,
  `unit` int(2) NOT NULL,
  `semester` int(2) NOT NULL,
  `code` varchar(255) NOT NULL,
  `title` varchar(255) NOT NULL,
  `sessions` varchar(40) NOT NULL,
  `staff_id` int(11) NOT NULL,
  PRIMARY KEY (`sn`),
  UNIQUE KEY `Programme` (`prog_id`,`semester`,`code`,`sessions`)
) ENGINE=InnoDB AUTO_INCREMENT=768 DEFAULT CHARSET=latin1;

