DROP TABLE IF EXISTS departments;

CREATE TABLE `departments` (
  `dept_id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `code` varchar(20) NOT NULL,
  `schl_id` int(11) NOT NULL,
  PRIMARY KEY (`dept_id`),
  UNIQUE KEY `name` (`name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS entered;

CREATE TABLE `entered` (
  `sn` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(10) NOT NULL,
  `unit` int(11) NOT NULL,
  `prog_id` varchar(255) NOT NULL,
  `semester` varchar(255) NOT NULL,
  `session` varchar(255) NOT NULL,
  PRIMARY KEY (`sn`)
) ENGINE=InnoDB AUTO_INCREMENT=250 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS logintbl;

CREATE TABLE `logintbl` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(255) NOT NULL,
  `password` varchar(2810) NOT NULL,
  `progs` varchar(255) NOT NULL,
  `t_user` int(11) NOT NULL,
  `status` varchar(11) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`,`password`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS menu_control;

CREATE TABLE `menu_control` (
  `menu_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_type_id` int(11) NOT NULL,
  `menu_name` varchar(100) NOT NULL,
  `status` int(11) NOT NULL,
  PRIMARY KEY (`menu_id`),
  UNIQUE KEY `user_type_id` (`user_type_id`,`menu_name`)
) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS prev_results;

CREATE TABLE `prev_results` (
  `sn` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(60) NOT NULL,
  `matric_no` char(255) NOT NULL,
  `code` varchar(10) NOT NULL,
  `unit` int(11) NOT NULL,
  `score` varchar(5) NOT NULL,
  `grade` varchar(5) NOT NULL,
  `points` varchar(10) NOT NULL,
  `prog_id` varchar(255) NOT NULL,
  `semester` varchar(255) NOT NULL,
  `session` varchar(255) NOT NULL,
  `curent_sess` varchar(20) NOT NULL,
  `stat` int(1) NOT NULL,
  `co_spill` varchar(20) NOT NULL,
  PRIMARY KEY (`sn`),
  UNIQUE KEY `matric_no` (`matric_no`,`code`,`co_spill`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS programmes;

CREATE TABLE `programmes` (
  `prog_id` int(11) NOT NULL AUTO_INCREMENT,
  `programme` varchar(255) NOT NULL,
  `dept_id` int(11) NOT NULL,
  PRIMARY KEY (`prog_id`),
  UNIQUE KEY `dep` (`programme`)
) ENGINE=InnoDB AUTO_INCREMENT=55 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS results;

CREATE TABLE `results` (
  `sn` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(60) NOT NULL,
  `matric_no` char(255) NOT NULL,
  `code` varchar(10) NOT NULL,
  `unit` int(11) NOT NULL,
  `score` varchar(5) NOT NULL,
  `grade` varchar(5) NOT NULL,
  `points` varchar(10) NOT NULL,
  `prog_id` varchar(255) NOT NULL,
  `semester` varchar(255) NOT NULL,
  `session` varchar(255) NOT NULL,
  `stat` int(1) NOT NULL,
  PRIMARY KEY (`sn`),
  UNIQUE KEY `matric_no` (`matric_no`,`code`,`semester`)
) ENGINE=InnoDB AUTO_INCREMENT=22888 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS schools;

CREATE TABLE `schools` (
  `schl_id` int(11) NOT NULL AUTO_INCREMENT,
  `school` text NOT NULL,
  `schoolcode` varchar(10) NOT NULL,
  `college_id` int(11) NOT NULL,
  PRIMARY KEY (`schl_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS session;

CREATE TABLE `session` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `session` varchar(100) NOT NULL,
  `semester` varchar(100) NOT NULL,
  `status` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS staff;

CREATE TABLE `staff` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `names` varchar(100) NOT NULL,
  `number` varchar(50) NOT NULL,
  `contact` varchar(15) NOT NULL,
  `dept_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `number` (`number`)
) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS students_log;

CREATE TABLE `students_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `matric_no` varchar(100) NOT NULL,
  `password` varchar(20000) NOT NULL,
  `status` varchar(30) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `matric_no` (`matric_no`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS studentsnm;

CREATE TABLE `studentsnm` (
  `sn` int(11) NOT NULL AUTO_INCREMENT,
  `names` varchar(255) NOT NULL,
  `matno` varchar(255) NOT NULL,
  `prog_id` varchar(255) NOT NULL,
  `year` int(11) NOT NULL,
  `images` varchar(255) NOT NULL,
  `session` varchar(255) NOT NULL,
  `status` int(1) NOT NULL,
  `stat` int(1) NOT NULL,
  `Withdrwan` int(1) NOT NULL,
  `sex` varchar(2) NOT NULL,
  UNIQUE KEY `sn` (`sn`),
  UNIQUE KEY `matno` (`matno`)
) ENGINE=InnoDB AUTO_INCREMENT=2039 DEFAULT CHARSET=latin1;

