DROP TABLE IF EXISTS sub_menu_control;

CREATE TABLE `sub_menu_control` (
  `s_menu_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_type_id` int(11) NOT NULL,
  `menu_id` int(11) NOT NULL,
  `s_menu_name` varchar(100) NOT NULL,
  `xtension` varchar(100) NOT NULL,
  `status` int(11) NOT NULL,
  PRIMARY KEY (`s_menu_id`),
  UNIQUE KEY `user_type_id` (`user_type_id`,`s_menu_name`)
) ENGINE=MyISAM AUTO_INCREMENT=42 DEFAULT CHARSET=latin1;




